import * as S from "./styles";

export const Header: React.FC = () => {
  return (
    <S.StyledHeader>
        <S.Wraper></S.Wraper>
      <S.HeaderTitle>MyShop.</S.HeaderTitle>

      <S.ButtonsWrapper>
        <S.AuthButton>Lofin</S.AuthButton>
        <S.CartButton>Carrinho</S.CartButton>
      </S.ButtonsWrapper>
    </S.StyledHeader>
  );
};
